import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import { ScatterChart, Scatter, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

const App = () => {
    const [xMin, setXMin] = useState('');
    const [xMax, setXMax] = useState('');
    const [yMin, setYMin] = useState('');
    const [yMax, setYMax] = useState('');
    const [numPoints, setNumPoints] = useState('');
    const [timeMin, setTimeMin] = useState('');
    const [timeMax, setTimeMax] = useState('');
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [entities, setEntities] = useState([]); 

    useEffect(() => {
        const intervalId = setInterval(() => {
            setData(prevData =>
                prevData
                    .map(item => ({ ...item, seconds: item.seconds - 1 }))
                    .filter(item => item.seconds > 0)
                    .sort((a, b) => b.seconds - a.seconds));
        }, 1000);

        return () => clearInterval(intervalId);
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        // ... (שאר הקוד של handleSubmit נשאר כמו שהוא)
        fetchData();
    };

    const fetchData = async () => {
        setLoading(true);
        try {
            const arr = [
                parseInt(xMin),
                parseInt(xMax),
                parseInt(yMin),
                parseInt(yMax),
                parseInt(numPoints),
                parseInt(timeMin),
                parseInt(timeMax),
            ];

            const response = await axios.post('http://localhost:8080/api/settings', arr);
            console.log('Response from backend:', response.data);

            setData([]); // Clear the current data on successful response

            // קבל נתונים מה-API של הישויות
            const entitiesResponse = await axios.get('http://localhost:5001/array');
            setEntities(entitiesResponse.data.entities); // הוסף את הישויות החדשות

        } catch (error) {
            console.error('Error posting data:', error);
            setError('Error posting data: ' + (error.response?.data || error.message));
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        const fetchInitialEntities = async () => {
            try {
                const response = await axios.get('http://localhost:5001/array');
                setEntities(response.data.entities);
            } catch (error) {
                console.error('Error fetching entities:', error);
            }
        };

        fetchInitialEntities();
    }, []);

    const isLocked = data.length > 0;

    return (
        <div className="app-container">
            <h1>RGraph</h1>

            <div className="horizontal-container">
                <div className={`input-container ${isLocked ? 'locked' : ''}`}>
                    {isLocked && (
                        <div className="locked-message">
                            הטבלה נעולה, אנא חכה לסיום הריצה
                        </div>
                    )}

                    <h2>Input Values</h2>
                    <form onSubmit={handleSubmit}>
                        {/* (שאר הקוד של הטופס נשאר כמו שהוא) */}
                    </form>
                </div>

                <div className="scroll-container">
                    <h2>MongoDB Entities</h2>
                    {entities.map((entity) => (
                        <div key={entity._id} className="entity-item">
                            <p>{entity["runtime:"]}</p> {/* גישה לשדה runtime */}
                        </div>
                    ))}
                </div>

                <div className="data-table-container">
                    <h2>Live Data Table</h2>
                    {loading ? (
                        <p>Loading data...</p>
                    ) : (
                        <table className="data-table">
                            {/* (שאר הקוד של הטבלה נשאר כמו שהוא) */}
                        </table>
                    )}
                </div>

                <div className="chart-container">
                    <h2>LIVE Graph</h2>
                    <ScatterChart width={400} height={400}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="x" name="X" type="number" domain={[0, 100]} />
                        <YAxis dataKey="y" name="Y" type="number" domain={[0, 100]} />
                        <Tooltip cursor={{ strokeDasharray: '3 3' }} />
                        <Scatter data={data} fill="#4CAF50" shape={<CustomizedDot />} />
                    </ScatterChart>
                </div>
            </div>
        </div>
    );
};

const CustomizedDot = (props) => {
    const { cx, cy } = props;
    return (
        <circle cx={cx} cy={cy} r={6} fill="#2196F3" stroke="#FFF" strokeWidth={2} />
    );
};

export default App;
